import React from 'react';
import ReactDOM from 'react-dom';
import sdata from './Sdata';
import Cards from './cards'
import './index.css';


ReactDOM.render(
    <>
    <h1 className="heading">List of Best Five Netflix Webseries</h1>
     {sdata.map((val) =>{
        return (
       <Cards 
       key={val.id}
       imgsrc={val.imgsrc}
       title={val.title}
       sname={val.sname}
       links={val.links}
       />    
     ) 
     })}

    </>
    ,document.getElementById("root")
);
